import classes from './CartItem.module.css'

let CartItem = (props)=>{

let dataFilterer = props.filter((data)=>{
return data.name == props.name
})

return(
    <>
    <div className={classes['cart-item']}>
<h2>
    {props.name}
</h2>
<div className={classes.price}>
{props.price}
    </div>
    <h1>{dataFilterer}</h1>
    </div>
    </>
)
}

export default CartItem
